<h2>缓存雪崩</h2>
<p>问题描述：指缓存中<strong>大量数据在同一时间突然失效或者突然不可用时</strong>，大量的请求直接打到后端数据库，导致数据库压力剧增，甚至崩溃的现象。</p>
<h3>雪崩常见原因</h3>
<ul>
<li><strong>大量热点数据失效</strong>：热门数据在缓存中失效，会导致大量请求直接打到数据库，数据库压力骤增。</li>
<li><strong>缓存集中过期</strong>：如果大量缓存数据设置了相同或接近的过期时间，当这些缓存同时过期时，大量请求会同时打到后端数据库。</li>
